using System.Collections.Generic;
using LeetCodeProblemsLibrary.Attributes;
using Xunit;

namespace LeetCodeProblemsLibrary.Medium;

public class MediumUnitTests
{
    [Theory]
    [LeetCodeTags("Array")]
    [InlineData(new[] { 7, 1, 5, 3, 6, 4 }, 7)]
    [InlineData(new[] { 1, 2, 3, 4, 5 }, 4)]
    [InlineData(new[] { 7, 6, 4, 3, 1 }, 0)]
    public static void MaxProfit122_Test(int[] prices, int expected)
    {
        // Arrange & Act
        var result = MaxProfit122.MaxProfit(prices);
        
        // Assert
        Assert.Equal(expected, result);
    }
    
    [Theory]
    [LeetCodeTags("Math")]
    [InlineData(1, 1)]
    [InlineData(2, -1)]
    [InlineData(3, 3)]
    [InlineData(4, -1)]
    [InlineData(5, -1)]
    [InlineData(6, -1)]
    [InlineData(7, 6)]
    [InlineData(8, -1)]
    [InlineData(9, 9)]
    [InlineData(10, -1)]
    public static void SmallestRepunitDivByK1015_Test(int k, int expected)
    {
        // Arrange & Act
        var result = SmallestRepunitDivByK1015.SmallestRepunitDivByK(k);
        
        // Assert
        Assert.Equal(expected, result);
    }
    
    [Theory]
    [LeetCodeTags("String", "Prefix-Sum")]
    [InlineData("0110111", 9)]
    [InlineData("111111", 21)]
    [InlineData("101", 2)]
    [InlineData("11110", 10)]
    [InlineData("00000000", 0)]
    [InlineData("1111111", 28)]
    [InlineData("", 200542505)]
    public void NumSub1513_Test(string s, int expected)
    {
        // Arrange & Act
        var result = NumSub1513.NumSub(s);

        // Assert
        Assert.Equal(expected, result);
    }

    [Theory]
    [LeetCodeTags("Array", "Prefix-Sum", "Difference Array")]
    [InlineData(new[] { 3, 6, 5, 1, 8 }, 18)]
    [InlineData(new[] { 4 }, 0)]
    [InlineData(new[] { 1, 2, 3, 4, 4 }, 12)]
    [InlineData(new[] { 2, 6, 2, 2, 7 }, 15)]
    [InlineData(new[] { 2, 3, 36, 8, 32, 38, 3, 30, 13, 40 }, 195)]
    public static void MaxSumDivThree1262_Test(int[] nums, int expected)
    {
        // Arrange & Act
        var result = MaxSumDivThree1262.MaxSumDivThree(nums);

        // Assert
        Assert.Equal(expected, result);
    }

    [Theory]
    [LeetCodeTags("Array", "Prefix-Sum", "Difference Array")]
    [InlineData("", 0)]
    [InlineData("a", 0)]
    [InlineData("aa", 0)]
    [InlineData("aaa", 1)]
    [InlineData("aaaa", 1)]
    [InlineData("ab", 0)]
    [InlineData("abc", 0)]
    [InlineData("abba", 1)]
    [InlineData("abcba", 3)]
    [InlineData("abccba", 3)]
    [InlineData("aabca", 3)]
    [InlineData("adc", 0)]
    [InlineData("bbcbaba", 4)]
    public void CountPalindromicSubsequence1930_Test(string s, int expected)
    {
        // Arrange & Act
        var result = CountPalindromicSubsequence1930.CountPalindromicSubsequence(s);

        // Assert
        Assert.Equal(expected, result);
    }
    
    [Theory]
    [LeetCodeTags("Array", "Prefix-Sum", "Difference Array")]
    [MemberData(nameof(TestData2536))]
    public void RangeAddQueries2536_Test(int n, int[][] queries, int[][] expected)
    {
        // Arrange & Act
        var result = RangeAddQueries2536.RangeAddQueries(n, queries);

        // Assert
        Assert.Equal(expected, result);
    }
    
    [Theory]
    [LeetCodeTags("String", "Prefix-Sum")]
    [InlineData("00011", 5)]
    [InlineData("101101", 16)]
    public void NumberOfSubstrings3234_Test(string s, int expected)
    {
        // Arrange & Act
        var result = NumberOfSubstrings3234.NumberOfSubstrings(s);

        // Assert
        Assert.Equal(expected, result);
    }
    
    public static IEnumerable<object[]> TestData2536()
    {
        yield return
        [
            3,
            new int[][] 
            {
                [1, 1, 2, 2],
                [0, 0, 1, 1]
            },
            new int[][] 
            {
                [1, 1, 0],
                [1, 2, 1],
                [0, 1, 1]
            }
        ];
    }
}
